import React, { Component } from "react";
import { Container, Input, Menu, Segment } from "semantic-ui-react";
import { Button } from "semantic-ui-react";
import "./Navi.css";

export default function Navi() {
  const mystyle = {
    padding: "10px",
    fontFamily: "Arial"
  };

  return (
    <div>
      <Menu style={{ backgroundColor: "#9932cc"}} fixed="top" size="large">
          <Container>
            <Menu.Item name="Home" className="font-weight-bold"/>
            <Menu.Item name="messages" />
            <Menu.Item name="friends" />
            <Container className="d-flex justify-content-end">
              <Button.Group position="right">
                <Button className="font-weight-bold">Sepetim</Button>
              </Button.Group>
            </Container>
          </Container>
        </Menu>
    </div>
  )
}
